const AnotherPage = () => {
    return (
      <div>
        <h1>Thank you for filling the form ! You will recieve an email with the report very soon </h1>
        <p>  </p>
        <img src={report} alt="logo1" className="report" />
      </div>
    );
  };

  export default AnotherPage;
